      if (this.props.visible === false) {
        setTimeout(function() {
          this.setState({render: false})
        }.bind(this), 1000)
      }
    }

    render() {

        if (this.props.visible === true && this.props.pageNum === 1) {
            return (
                    <div id="contentContainer">
                        <div className="contentCanvas">
                            <ul id="soloProList">
                                <li id="soloPro1"></li>
                                <li id="soloPro1"></li>
                                <li id="soloPro1"></li>
                            </ul>
                        </div>
